import React from 'react'
import './Card.css';

const Card = (props) => {
  return (
    <div className='card'>
        {props.people.map((person) => {
        <ul>
          <li>person.name</li>
          <li>person.birthday</li>
        </ul>
        })}
    </div>
  )
}

export default Card
